import React from 'react';
import styled from '@emotion/styled';

const Dim = styled.div`
  position: fixed;
  width: 100vw;
  height: 100vh;
  top: 50%;
  left: 50%;
  background-color: black;
  transform: translate(-50%, -50%);
  opacity: 0.5;
`;

const ModalBlock = styled.div`
  position: fixed;
  width: 80vw;
  height: 80vh;
  top: 50%;
  left: 50%;
  background-color: black;
  transform: translate(-50%, -50%);
  z-index:9999
  opacity: 1;
`;

const PreventScroll = styled.div`
  position: fixed;
  width: 100%;
  height: 100%;
  overflow: hidden;
`;

const ModalFrame = () => {
  return (
    <Dim>
      <ModalBlock>
        <h1>상세 페이지</h1>
      </ModalBlock>
    </Dim>
  );
};

export default ModalFrame;
